import React from "react";

class TodoList extends React.Component {
  constructor() {
    super();
    this.state = {
      list: [],
      task: {
        id: 0,
        task: "",
        completed: false
      }
    };
  }

  render() {
    return (
      <div className="listMainContainer">
        <div className="listContainer">
          <p>test</p>
        </div>
      </div>
    );
  }
}
export default TodoList;
